import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>To-Do List Web Application</h1>
      <input />
      <button>Add Item</button>

      <ul>
        <li>Skuhaj Veceru</li>
        <li>Uradi Zadacu</li>
      </ul>
    </div>
  );
}

export default App;
